import{_ as e,o as a,c as t,O as o}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 2.2-509.1 Powers of investigators; enforcement of certain tobacco laws.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/2.2-509.1.md","filePath":"vacode/2.2-509.1.md"}'),r={name:"vacode/2.2-509.1.md"},i=o('<h1 id="§-2-2-509-1-powers-of-investigators-enforcement-of-certain-tobacco-laws" tabindex="-1">§ 2.2-509.1 Powers of investigators; enforcement of certain tobacco laws. <a class="header-anchor" href="#§-2-2-509-1-powers-of-investigators-enforcement-of-certain-tobacco-laws" aria-label="Permalink to &quot;§ 2.2-509.1 Powers of investigators; enforcement of certain tobacco laws.&quot;">​</a></h1><p>Investigators with the Office of the Attorney General as designated by the Attorney General shall be authorized to seize cigarettes as defined in § <a href="/vacode/3.2-4200/">3.2-4200</a>, which are sold, possessed, distributed, transported, imported, or otherwise held in violation of § <a href="/vacode/3.2-4207/">3.2-4207</a> or <a href="/vacode/58.1-1037/">58.1-1037</a>. In addition, such investigators shall be authorized to accompany and participate with special agents of the Virginia Alcoholic Beverage Control Authority or other law-enforcement officials engaging in an enforcement action under § <a href="/vacode/3.2-4207/">3.2-4207</a> or <a href="/vacode/58.1-1037/">58.1-1037</a>.</p><p>2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0695" target="_blank" rel="noreferrer">695</a>; 2015, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0038" target="_blank" rel="noreferrer">38</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?151+ful+CHAP0730" target="_blank" rel="noreferrer">730</a>.</p>',3),n=[i];function c(s,f,l,d,h,_){return a(),t("div",null,n)}const v=e(r,[["render",c]]);export{p as __pageData,v as default};
